#define SE_PAIR_EXPAND(Name,x) {SE_STRING_EXPAND(Name,x),SE_ENUM_EXPAND(Name,Name ::Enum::x)}

#define STRING_ENUM_DECLARE(Name,...)\
        class Name{\
        public:\
            enum Enum{SE_FOREACH(Name,SE_ENUM_EXPAND,__VA_ARGS__)};\
        private:\
            static std::vector<std::string> enumToString;\
        public:\
            Name()=delete;\
            static std::map<std::string,enum Enum> stringEnumMap;\
            static const std::string &getString(enum Enum e){return enumToString[(int)e];}\
            static const enum Enum getEnum(const std::string &str){\
                auto target = stringEnumMap.find(str);\
                if(target==stringEnumMap.end()){\
                    std::string err = "can not find ";\
                    throw std::invalid_argument(err+str);\
                }\
                return target->second;}\
        };

#define STIRNG_ENUM_DEFINE(Name,...) std::vector<std::string> Name ::enumToString={SE_FOREACH(Name,SE_STRING_EXPAND,__VA_ARGS__)};\
        std::map<std::string,Name ::Enum> Name ::stringEnumMap={SE_FOREACH(Name,SE_PAIR_EXPAND,__VA_ARGS__)};


#define STRING_ENUM(Name,...) STRING_ENUM_DECLARE(Name,__VA_ARGS__) \
                                STIRNG_ENUM_DEFINE(Name,__VA_ARGS__)


